import Vue from 'vue'
import App from './App.vue'
import Home from './view/Home.vue'

// import router from './router/index.js'
import VueRouter from 'vue-router'

Vue.use(VueRouter)

const routes = [
	{
		path: "/",
		component: Home
	}
]


const router = new VueRouter({
	routes
})

Vue.config.productionTip = false






new Vue({
  render: h => h(App),
  router
}).$mount('#app')
